import React from "react";

const ActionButtons = ({ state, setPrevStep, setNextStep }) => {
  return (
    <div className="inline block">
      <div className="footer">
        <div className="row">
          <button className="btn btn-primary" onClick={setPrevStep(state)}>
            Previous
          </button>
          <button className="btn btn-primary" onClick={setNextStep(state)}>
            Next
          </button>
        </div>
        <div className="row" />
      </div>
    </div>
  );
};

export default ActionButtons;
